cover = ["pytest-cov"]
doc = ["furo", "jaraco.packaging (>=9.3)", "jaraco.tidelift (>=1.4)", "rst.linker (>=1.9)", "sphinx (>=3.5)", "sphinx-lint"]
enabler = ["pytest-enabler (>=2.2)"]
test = ["big-O", "jaraco.functools", "jaraco.itertools", "jaraco.test", "more_itertools", "pytest (>=6,!=8.1.*)", "pytest-ignore-flaky"]
type = ["pytest-mypy"]

[extras]
cbor = ["cbor2"]
metrics = ["prometheus_client"]
msgpack = ["msgpack"]
opentelemetry = ["opentelemetry-api", "opentelemetry-instrumentation", "opentelemetry-semantic-conventions"]
orjson = ["orjson"]
reload = ["gitignore-parser", "watchdog"]
uv = ["uvloop"]
zmq = ["pyzmq"]

[metadata]
lock-version = "2.1"
python-versions = ">=3.9,<4"
content-hash = "2db82a9b6253624b3fec3909debbd20c373a4e90897c2dcf5ffc3f193b5e2715"